import React, {Component} from 'react';
import './body.css'

class Body extends Component{
    state = {
        color:'transparent',
    }
    handleMouseOver(e){
        this.setState({
        color:'white'
        })
    }
    render(){
        return(
            <div class="mainPage">
                <div class = "mainPageContent">
                    <div class = "mainPageName">
                        Food App
                    </div>
                    <div class = "mainPageText">
                        EXPERIENCE THE JOY OF FOOD
                    </div>
                </div>
                <div class = "menu">
                    <button onMouseOver={this.handleMouseOver} style={{background:this.state.color}}>See Menu</button>
                    <button>Order Online</button>
                    <button>Reservations</button>
                </div>
            </div>

        );
    }
}

export default Body;
